import React from 'react';
import './DataVisualization.css';

const DataVisualization = () => {
  return (
    <div className="dashboard">
      <div className="sidebar">
        <h2>Sidebar</h2>
        <ul>
          <li>Item 1</li>
          <li>Item 2</li>
          {/* Add more sidebar items */}
        </ul>
      </div>
      <div className="main-content">
        <div className="box">
          <h2>Main Content Box 1</h2>
          <p>Content here...</p>
        </div>
        <div className="box">
          <h2>Main Content Box 2</h2>
          <p>Content here...</p>
        </div>
        {/* Add more main content boxes */}
      </div>
    </div>
  );
};

export default DataVisualization;
